import "./Button.css"
import PianoIcon from "./piano.png";
import axios from 'axios';

const Button = () => {

    const sendPost =axios({
        method: 'post',
        url: 'https://localhost:6969/',
        data: {boris:'natasha'
      
        }
      })
    return ( <div class="container">
        <div class="upCenter">
        <img src={PianoIcon} /> 
        </div>
    
    <       div class="center">
    
      <button onClick={sendPost} >Click here to create a music </button>
    </div>
  </div>);
};

export default Button;
